column13:
An imaging system (12, 300) comprising: 
a processor (22) operatively connected with a display device (34); 
at least one photosensor operatively connected with the processor and configured to generate a visualization of a surgical site of a patient; 
a multidimensional visualization generation system (304) operatively connected with the processor and configured to create a multidimensional visualization based on the generated visualization of the surgical site; 
a multidimensional image reconstruction module (306) operatively connected with the processor and configured to receive a selection corresponding to a portion of the multidimensional visualization, generate a multidimensional reconstructed image related to the surgical site, and select a portion of the multidimensional reconstructed image that corresponds to the selected portion of the multidimensional visualization; and 
a fusion module (310) operatively connected with the processor and configured to fuse the portion of the multidimensional reconstructed image with the multidimensional visualization; 
wherein the processor is configured to display the multidimensional visualization and the multidimensional reconstructed image with the portion of the multidimensional reconstructed image appearing as being underlaid with respect to the selected portion of the multidimensional visualization, overlaid with respect to the selected portion of the multidimensional visualization or displayed instead of the selected portion of the multidimensional visualization.
